import React from "react"
import styles from "./navbar.css"
import classNames from "classnames"
import bookstoreIcon from "./bookstore-icon.svg"

const cx = classNames.bind(styles)

const Navbar = (props) => {
    return (
        <div className={cx["container"]}>
            <bookstoreIcon />
        </div>
    )
}
